import React from 'react'
import { Row, Col } from 'react-bootstrap'
import galleryimgs from './galleryimgs'
//import Galleryimg from '../src/components/Galleryimg'


const Gallerydisplay = () => {


    return (

        <div className='box'>
            <Row style={{ height: 'auto' }}>
              { galleryimgs.map((galleryimg) => (
                <Col style={{  }} sm={12} md={4} lg={4} xl={3}>
                    <Card>
                        <a href={`/gallerimgs/${gallerimg.id}`} >
                            <Card.Img src={gallerimg.image} variant='top' style={{ height: '150px' }} />
                        </a>               
                    </Card>
                </Col>
                ))}
            </Row>
        </div>
    )
}

export default Gallerydisplay
